import React, { useState, useEffect } from 'react';
import { View, FlatList, Image, Text } from 'react-native';

interface Member {
    login: string;
    avatar_url: string;
}

const Main: React.FC = () => {
    const [members, setMembers] = useState<Member>([]);

    useEffect(() => {
        fetch('https://api.github.com/orgs/rocketset/members').then(response => {
            response.json().then(data => {
                setMembers(data);
            })
        })
    })
    return (
        <FlatList data={members}
            KeyExtractor={member => member.login}
            renderItem={({ item: member }) => (
                <View>
                    <Image width={20} source={{ uri: member.avatar_url }} />
                    <Text>{member.login}</Text>
                </View>
            )} />
    )
};

export default Main;
